CREATE FUNCTION public.atomic_query(p_id integer, p_representation integer, p_type integer, p_cath integer, p_len integer, p_top integer) RETURNS TABLE(type_id integer, id integer, id_code text, id_parent integer, len integer, class integer, architecture integer, topology integer, homologous integer, factor numeric, euclidean_distance double precision)
    LANGUAGE plpgsql
    AS $$
   declare 
         v_id_len bigint;
BEGIN 
   select public.get_length_sequence(a.id_code) 
   into v_id_len
   from public.atomic_structure a
   where a.id = p_id;
   
   return query
   select t_atomic.atomic_structure_type_id, t_atomic.id, t_atomic.id_code, t_atomic.parent, t_atomic.len ,
          t_atomic.class_number, t_atomic.architecture_number, t_atomic.topology_number,
		  t_atomic.homologous_superfamily_number, t_atomic.factor, e.distance as euclidean_distance
		  FROM (select b.atomic_structure_type_id, b.id, b.id_code, b.parent, b.len ,
          b.class_number, b.architecture_number, b.topology_number, b.homologous_superfamily_number,
		  ((b.len * 1.0)  / (v_id_len * 1.0)) as factor
   from 
   (
   select a.atomic_structure_type_id, a.id, a.id_code, a.parent, public.get_length_sequence(a.id_code) as len ,
          c.class_number, c.architecture_number, c.topology_number, c.homologous_superfamily_number
   from public.atomic_structure a
        inner join public.cath_atomic_structure c
		    on a.id = c.atomic_structure_id
		left join LATERAL (select me.class, me.architecture, me.topology, me.homologous
						   from public.get_cath(p_id) me) as me on true
   where (p_representation = 0)
     and (p_type = 0 or
		 (a.atomic_structure_type_id = p_type))
	 and (p_cath = 0
		  or (p_cath = 1 and c.class_number = me.class
			  and c.architecture_number = me.architecture
			  and c.topology_number = me.topology
			  and c.homologous_superfamily_number = me.homologous)
		  or (p_cath = 2 and c.class_number = me.class
			  and c.architecture_number = me.architecture
			  and c.topology_number = me.topology)
		  or (p_cath = 3 and c.class_number = me.class
			  and c.architecture_number = me.architecture)
		  or (p_cath = 4 and c.class_number = me.class)
		 )
	   ) b
	   where b.id <> p_id
	         and (p_len = 0
				 or (p_len = 1 and (b.len / v_id_len) between 0.57 and 1.75))) t_atomic
	  join (select * from top_distance_pdb(p_id, p_top)) e
	  		on t_atomic.id = e.atomic_id
   order by euclidean_distance;
   
END $$;


