CREATE FUNCTION public.get_length_sequence(id_mol text) RETURNS integer
    LANGUAGE plpgsql
    AS $$ 
DECLARE
	length_sequence INTEGER := 0;
BEGIN
	SELECT (
		SELECT COUNT(*) FROM(
			SELECT regexp_split_to_table(
