CREATE FUNCTION public.top_distance_pdb(atomic_id_p integer, top_can integer) RETURNS TABLE(distance double precision, atomic_id integer)
    LANGUAGE plpgsql
    AS $$
  DECLARE
  len INTEGER := 0;
  numbers_pdb JSON;
  BEGIN
    SELECT json_array_length(a.numbers_descriptor), a.numbers_descriptor INTO len, numbers_pdb FROM public.atomic_structure a WHERE a.id = atomic_id_p;
    RETURN QUERY
    SELECT euclidean_distance(a.numbers_descriptor, numbers_pdb, len) as distance, a.id 
  FROM atomic_structure a
  WHERE a.id != atomic_id_p
  ORDER BY distance
  LIMIT top_can;
  END
$$;


